public static StoragePolicy valueOf(int value) {
  switch (value) {
  case 1:
    return PROVIDED;
  case 2:
    return COLD;
  case 5:
    return WARM;
  case 7:
    return HOT;
  case 10:
    return ONE_SSD;
  case 12:
    return ALL_SSD;
  case 15:
    return LAZY_PERSIST;
  default:
    return null;
  }
}
